import React from "react";

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light mt-3">
      <div className="container-fluid px-4 mx-4">
        <a className="navbar-brand ms-3" href="#">Doggo</a>
        <a className="btn btn-secondary px-4 mx-2">List</a>
        <div className=" navbar-collapse justify-content-between" id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item">
              <a className="btn btn-secondary px-4 mx-2">List</a>
            </li>
            <li className="nav-item">
              <a className="btn btn-secondary px-4 mx-2">Track</a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
